import React, { memo } from "react";
import titlecheckin from "../assets/titlecheckin.png";
import checkin from "../assets/checkin.png";

const ChaoMungComponent = ({ userCurrent }) => {
  return (
    <div
      className="chao-mung-container"
    >
      <img
        src={titlecheckin}
        style={{ width: "100%", marginTop: "1vh" }}
        alt="Welcome to the Check-in"
      />
      <h2
        className="font-large text-blue"
        style={{
          textTransform: "uppercase",
          marginBottom: "1.15vh",
          fontSize: "2.5vw",
          lineHeight: 1.2,
        }}
      >
        {userCurrent?.nguoidaidien || "."}
      </h2>
      <h2
        className="font-large text-blue"
        style={{
          textTransform: "uppercase",
          marginBottom: "1.15vh",
          fontSize: "1.75vw",
          lineHeight: 1.2,
        }}
      >
        {userCurrent?.chucvu} {userCurrent?.tencongty || "."}
      </h2>
      <img
        src={checkin}
        style={{ width: "70%", marginTop: "1vh" }}
        alt="Welcome to the Check-in"
      />
    </div>
  );
};

export default memo(ChaoMungComponent);
